import React from 'react';

const About = () => {
  return (
    <div className="min-h-screen flex flex-col justify-center items-center px-4 max-w-4xl mx-auto">
      <h2 className="text-4xl font-bold text-[#2E4052] mb-8">About Me</h2>
      <div className="bg-white/50 rounded-lg p-8 hover:shadow-lg transition-shadow">
        <p className="text-lg text-[#2E4052] mb-6">
          I am a Data Engineer and Software Developer with a passion for building scalable data pipelines and web applications. 
          My expertise lies in Python, SQL, and modern web technologies, allowing me to create efficient and robust solutions 
          for complex data challenges.
        </p>
        <p className="text-lg text-[#2E4052] mb-6">
          With a strong foundation in both software engineering and data science, I bring a unique perspective to projects, 
          combining technical expertise with analytical thinking. I am constantly learning and adapting to new technologies 
          to stay at the forefront of the industry.
        </p>
        <p className="text-lg text-[#2E4052]">
          When I'm not coding, I enjoy exploring new technologies, contributing to open-source projects, and sharing my 
          knowledge with the developer community. I believe in writing clean, maintainable code and creating solutions 
          that make a real impact.
        </p>
      </div>
    </div>
  );
};

export default About;
